import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "../nav/Navbar.css";
import Logoimg from "../../assets/Udaan_logo2.png";
import { Link } from "react-router-dom";
import CoustomDropdown from "../../component/dropdown/CustomDropdown";
// import { FiMenu, FiX } from "react-icons/fi";

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <nav className="navbar-main-container">
      <div className="nav-header">
        <div className="logo-container">
          <img className="logo-img " src={Logoimg} alt="" />
        </div>
        <div className="nav-elements-container ">
          <li>
            <Link className="nav-elements" to="/">
              Home
            </Link>
          </li>
          <li>
            <Link className="nav-elements" to="/about">
              About
            </Link>
          </li>
          <li>
            {/* <Link className="nav-elements" to="/service">
              Services
            </Link> */}
            <CoustomDropdown />
            <Routes>
              <Route path="/a" element={<Home />} />
              <Route path="/about" element={<About />} />
              <Route path="/services" element={<Services />} />
              <Route path="/contact" element={<Contact />} />
            </Routes>
          </li>
          <li>
            <Link className="nav-elements" to="/contact">
              Contact
            </Link>
          </li>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
